import React from 'react';

function Handsigns() {
    return(<HandObjects />);
}


class HandObjects extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: false,
            objects: null
        };

        this.getHandSigns = this.getHandSigns.bind(this);
    }

    getHandSigns() {
        if (this.state.objects != null) {
            return;
        }
        let url = "https://rps101.pythonanywhere.com/api/v1/objects/all"
        fetch(url)
        .then((response) => {
            return(response.json());
        }) .then((signs) => {
            console.log(signs);
            this.setState({objects:signs});
            console.log(this.state.objects);
        });
    }

    render() {
        this.getHandSigns();
        return null;
    }
}

export default Handsigns;
